import React from "react";
import { Outlet } from 'react-router-dom';
import NavLink from "../components/NavLink";
import NavLogo from "../components/NavLogo";
import Button from "../components/Button";

export default function Nav() {
    return (
        <div className="flex flex-col items-center w-full">
            <div className="relative w-full max-w-[1300px] h-auto flex items-center justify-between px-4 lg:px-0 my-6 z-10">
                
                {/* Nav Logo */}
                <div className="flex-shrink-0">
                    <NavLogo />
                </div>

                {/* Menu Links */}
                <div className="hidden lg:flex absolute lg:relative top-[13px] lg:top-0 left-0 lg:left-auto lg:right-auto lg:w-[505px] lg:h-[19px] justify-center">
                    <NavLink />
                </div>

                {/* Button */}
                <div className="flex-shrink-0 hidden lg:block">
                    <Button text='Login' />
                </div>
            </div>

            <div className="container mx-auto p-4">
                <Outlet />
            </div>
        </div>
    );
}
